import React from 'react';
import { Link } from 'react-router-dom';

const ImageList = (props) => (
  props.images.map(image =>
    <Link to="/images/edit/{image.id}">
      <img
        className='thumbnail'
        key={image.id}
        src={image.image_url}
        alt={image.id}
      />
    </Link>
    )
)

export default ImageList
